import React from "react";
import classes from './Header.module.css'
import { Container, Navbar } from 'react-bootstrap'
import logo from './logo/favicon.ico'


const Header = () => {

    return (
        <Navbar>
            <Container>
                <Navbar.Brand href="/">
                    <img
                        src={logo}
                        height={"30"}
                        width={"30"}
                        className="d-inline-block align-top"
                        alt="Logo"
                    />
                </Navbar.Brand>

            </Container>
        </Navbar>
    )
}

export default Header;
